import { Button, Typography } from "@mui/material";
import PersonOutlineOutlinedIcon from '@mui/icons-material/PersonOutlineOutlined';
import { TimelineContent, TimelineItem } from "@mui/lab";
import GetAppIcon from '@mui/icons-material/GetApp';

import BasicTimeline, {CustomTimelineSeperator} from "../Timeline/Timeline";
import resumeData from "../../utils/resumeData";
import CustomButton from "../Button/Button";

import './Profile.css';

const CustomTimelineItem = ({title, text, link}) => (
    <TimelineItem>
        <CustomTimelineSeperator />
        <TimelineContent className="timeline_content">
            {link ? (<Typography className="timelineItem_text"><span>{title}:</span> <a href={link} target="_blank" rel="noreferrer">{text}</a></Typography>) : 
            (<Typography className="timelineItem_text"><span>{title}:</span> {text}</Typography>)}
        </TimelineContent>
    </TimelineItem>
);

export default function Profile() {

    return(
        <div className="profile container">
            <div className="profile_name">
                <Typography className="name">{resumeData.name}</Typography>
                <Typography className="title">{resumeData.title}</Typography>
            </div>

            <figure className="profile_image">
                <img src={require('../../assets/images/img2.jpeg')} alt="Profile" />
            </figure>

            <div className="profile_details">
                <BasicTimeline icon={<PersonOutlineOutlinedIcon />}>
                    <CustomTimelineItem title='Name' text={resumeData.name} />
                    <CustomTimelineItem title='Title' text={resumeData.title} />
                    <CustomTimelineItem title='Email' text={resumeData.email} />

                    {Object.keys(resumeData.socials).map((key) => (
                        <CustomTimelineItem title={key} text={resumeData.socials[key].text} link={resumeData.socials[key].link} />
                    ))}
                </BasicTimeline>
                <br />
                <CustomButton text={"Download CV"} icon={<GetAppIcon />} />
            </div>
        </div>
    );

}
